import { Component, OnInit } from '@angular/core';
import { GlobalService } from './../global.service';
import { ApiService } from './../api.service';
import { Headers, RequestOptions} from '@angular/http';
import 'rxjs/add/operator/map';
import 'rxjs/add/operator/toPromise';
import {Router} from "@angular/router";
import Swal from 'sweetalert2';
import { HostListener } from '@angular/core';
import { ViewEncapsulation,ElementRef } from '@angular/core';
import { CookieService } from 'ngx-cookie-service';
import { DomSanitizer } from '@angular/platform-browser';

const swal = Swal;

@Component({
  selector: 'app-login',
  templateUrl: './login.component.html',
  styleUrls: ['./login.component.scss'],
  encapsulation: ViewEncapsulation.None,
})
export class LoginComponent {
	username:any=undefined;
	password:any;
  key = 1
  header = new Headers();

  disabled=true;
  vars:any;
  constructor(
    private elRef: ElementRef,
    private domSanitizer: DomSanitizer,
    private api: ApiService,
    public global: GlobalService,
    private router: Router,
    private cookieService: CookieService,
  ) {
    if (this.cookieService.get('domain') != '') {
      this.global.sysetting(this.cookieService.get('domain'), this.cookieService.get('year'));
    }

    if (this.global.getSession() != null) {
      this.router.navigate(['main']);
    }
    this.vars = this.domSanitizer.bypassSecurityTrustStyle("background-color:white;");
  }

  logout() {
    sessionStorage.clear();
    localStorage.clear();

  }

@HostListener('document:keypress', ['$event'])
  handleKeyboardEvent(event: KeyboardEvent) {
     if (event.key=='Enter' && !(swal.isVisible())) {
      this.login()
      }
  }
  ngAfterViewInit(){
    this.loadimage()
     let loader = this.elRef.nativeElement.querySelector('#loaderinside');
     //loader.style.display = "none"; //hide loader
     document.getElementById("loaderinside").style.display = "none";
  }
  loadimage(){
    var x= this.domSanitizer.bypassSecurityTrustStyle("background: url(data:image/gif;base64,);background-repeat: no-repeat; background-size: cover;height: calc(100vh - 70px);");
    //var x= this.domSanitizer.bypassSecurityTrustStyle("background: url(assets/St.jpg);background-repeat: no-repeat; background-size: cover;height: calc(100vh - 128px);");

     this.vars =x
  }

 checkiagree(){
   if (this.disabled==false) {
    this.disabled = true
   }else
     this.disabled = false;
 }

  login(){

    if (this.username == undefined || this.username ==  ''  || this.password == undefined  || this.password ==  '') {
      swal.fire(
          '',
           'Username and Password are Required!',
           'info'
          )
    }
    else{
      var header = new Headers();
          header.append("Content-Type", "application/json");
      let option = new RequestOptions({ headers: header });
        if (this.username==undefined) {
          this.username = "";
        } if (this.password==undefined) {
          this.password = "";
        }
      // swal.fire({
      //  title: 'Logging In...',allowOutsideClick: false,
      // });
      swal.fire({
       title: 'Logging In',
          text: '',         
          type: 'info',
          allowOutsideClick: false,
          allowEscapeKey: false,
          onOpen: () => {
            Swal.showLoading(); // Show the loading spinner
          }
        });
      //swal.showLoading();
        var id = this.global.tokenID
        this.api.postAuthlogin({
          'userName':this.username,
          'password':this.password,
          'AppName':'projectsite',        
          'AppId':id
        },option)
          .map(response => response.json())
          .subscribe(res => {
            //swal.close();
            //console.log(res)
            if (res.token==undefined) {
              if (res.message=='Account is locked out'||res.message=="Account is locked out.") {
               swal.fire(
                    res.message,
                    '',
                    'info'
                  )
              }else
             swal.fire(
                  "Invalid Credentials!",
                  'Username or Password is incorrect',
                  'info'
                )
            }else
            {
              this.global.requestToken(res.token);
              this.global.setSession(res.token);
              this.global.pass = this.password;
              this.global.setidname(this.username);
               // Store token in localStorage for persistence across tabs
              localStorage.setItem('authToken', res.token);
              this.router.navigate(['main']);
            }
          },Error=>{
            console.log(Error)
            this.global.swalErrorLog(Error)
          });
    }
  }
}
